export async function GET(req: any) {
  try {
    const url = await new URL(req.url);
    const language = url?.searchParams?.get("language");
    if (language) {
      const filterByLanguage = await dummyMusics.filter(
        (music) => music.language === language?.split("}")[0]
      );
      return NextResponse.json({
        status: 200,
        data: filterByLanguage,
      });
    } else {
      return NextResponse.json({
        status: 200,
        data: dummyMusics,
      });
    }
  } catch (error) {
    console.error(error);
    return NextResponse.json({
      status: 500,
      error: "Internal Server Error",
    });
  }
}
